public Object getValue(Object val)
{
	CommPort cp = ((DirectPort) val).getCommPort();
	
	cp.setSharedPortType( getJComboBoxPortType().getSelectedItem().toString() );
	
	if( isSocketTypeNone() )
		cp.setSharedSocketNumber( new Integer(CommPort.DEFAULT_SHARED_SOCKET_NUMBER) );
	else
		cp.setSharedSocketNumber( new Integer( ((Number)getJCSpinFieldSocketNumber().getValue()).intValue() ) );
		
	return val;
}
